def gene_provider(address):
    start = []
    end = []
    f = open(address, "r")
    content = f.readline()
    content = f.readline()
    while content != "":
        x = content.split(",")
        start.append(int(x[2]))
        end.append(int(x[3]))
        content = f.readline()
    return start, end


def gene_provider2(address):
    start = []
    end = []
    f = open(address, "r")
    content = f.readline()
    content = f.readline()
    while content != "":
        x = content.split(" ")
        start.append(int(x[2]))
        end.append(int(x[3]))
        content = f.readline()
    return start, end


def load_snps_positions():
    dt = pd.read_csv('Data/sparse_matrix/rows_complete.csv')
    dt.set_index(dt.columns[0], inplace=True, drop=True)

    snp_positions = []
    for col in dt.columns:
        col = ''.join(i for i in col if i.isdigit())
        snp_positions.append(col)

    indexNamesArr = dt.index.values
    listOfRowIndexLabels = list(indexNamesArr)
    return snp_positions


